import './App.css';
// import axios from 'axios';
import Header from './Header'
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Route
          exact path="/"
          element={this.props.auth0.isAuthenticated && <BestBooks />}
        >
        </Route>
        <Route
          path={"/about"}
          element={<About />}
        >
        </Route>
        <Route
          path={"/profile"}
          element={<Profile />}
        ></Route>
      </Routes>
      <div className="App">
        <h1>Hello</h1>
      </div>
    </>
  );
}

export default App;
